import React,{Component} from 'react';
export default class Home extends Component{
    render(){
        return(
            <div id='login'>
                <h1/>
                <div className='loginBg'>
                    <div className='loginPrompt'>
                        <i className='iconfont icon-mima'></i>
                        <span></span>
                    </div>
                </div>
            </div>
        )
    }
}
